using Leetcode.ArraysAndStrings;
using Leetcode.BinarySearch.Intro;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace TestLeetcode.ArraysAndStrings
{
    public class FindLongestSubstringContainingVowelsEvenCountsTest
    {
        // 1 <= s.length <= 5 x 10^5
        // s содержит только строчные английские буквы.

        [Test]
        [TestCase("eleetminicoworoep", 13)]
        [TestCase("leetcodeisgreat", 5)]
        [TestCase("bcbcbc", 6)]
        [TestCase("z", 1)]
        [TestCase("abcde", 3)]
        // ??? [TestCase("", 5255)]
        [TestCase("eeeeeiioooouuuuuu", 16)]
        [TestCase("iooaei", 2)]
        [TestCase("", 22720)]
        [TestCase("a", 0)]
        [TestCase("", 10500)]
        public void Test1(string s, int result)
        {
            Assert.That(
                new FindLongestSubstringContainingVowelsEvenCounts()
                    .FindTheLongestSubstring(s),
                Is.EqualTo(result)
                );
        }
    }
}
